import {Container, Navbar} from "react-bootstrap"
export default class NavBar extends React.Component {
    render() {
    return(
        <Navbar expand="lg" variant="light" bg="light">
        <Navbar.Brand href="#">Book store</Navbar.Brand>
      </Navbar>
      )
    }
    }
